              "fields": {
                "internalName": {
                  "en-US": "re|engage details"
                },
                "detailedDescription": {
                  "en-US": "1. Prevent Burnout\nPrevents staff burnout and fatigue as it creates a clear path for counseling couples. One of our biggest reasons for starting re|engage was to help offload the marriage counseling burden felt by our church staff. Volunteers can be positioned for success to take on this responsibility (2 Peter 1:3).\n\n1. Create Service Opportunities\nCreates service opportunities for the local body of Christ. re|engage drives a need for leader couples who in turn love other couples at a time when they are hurting (1 John 3:18). And leader couples often experience improvement in their own marriage as a result of serving!\n\n1. Reach the Unchurched\nCouples who may never walk through the front door of your church may be driven to re|engage and the good news of Jesus Christ by the pain they are feeling in a strained marital relationship (Matthew 11:28).\n\n1. Make Disciples\nProvides a great opportunity to make disciples. The re|engage curriculum is the gospel applied to marriage (Ephesians 5:25). Take a look at the first lesson by clicking here. Participants in re|engage are often confronted with a loving God they have never met and ultimately embrace His free gift!"
                },
